import { StyleSheet } from "react-native";
import { Colors } from "../settings/styles/theme";

const styles = StyleSheet.create({
    container: {
        backgroundColor: "white"
    },
    title: {
        textAlign: "left",
        color: Colors.PRIMARY,
        flex: 1
    }
});


export default styles;
